                )
                break;
            case 100: 
                return(
                    <div>
                        <img src={image5}/>
                    </div>
                )
                break;


        }
    }

    render(){
        return(
            <div>
                {this.imageGenerator(this.props.phase)}
            </div>
        )
    }
}

export default Image;
